import React, {Component} from 'react';
import {Link, Route, Switch} from 'react-router-dom';
// import {AnimatedSwitch} from 'react-router-transition';
// import {TransitionGroup, CSSTransition} from 'react-transition-group';
import Home from './Home';
import About from './About';
import Service from './Service';
import Contact from './Contact';
import Portfolio from './Portfolio';
import axios from 'axios';

class Header extends Component{
    constructor(props){
        super(props);
        this.state = {
            configData : {},
            contactData : {}
        }
    }
    componentDidMount(){
        axios.get('http://localhost/config')
            .then(res => {
            this.setState({configData : res.data.result})
        });

        axios.get('http://localhost/contact')
            .then(res => {
                this.setState({contactData : res.data.result[0]});
                console.table(res.data.result[0]);
        })
    }
    render(){
        // const {configData} = this.state;
        return(
            <>
                <header className="main_menu home_menu">
                    <div className="container">
                        <div className="row align-items-center">
                        <div className="col-lg-12">
                            <nav className="navbar navbar-expand-lg navbar-light">
                            <a className="navbar-brand" href="index.html">
                                <img src="spada/logo.png" alt="logo" />
                            </a>
                            <button
                                className="navbar-toggler"
                                type="button"
                                data-toggle="collapse"
                                data-target="#navbarSupportedContent"
                                aria-controls="navbarSupportedContent"
                                aria-expanded="false"
                                aria-label="Toggle navigation"
                            >
                                <span class="ti-menu"></span>
                            </button>

                            <div
                                className="collapse navbar-collapse main-menu-item justify-content-center"
                                id="navbarSupportedContent"
                            >
                                <ul className="navbar-nav align-items-center">
                                <li className="nav-item">
                                   <Link className={'nav-link'} to={'/'}>Home</Link>
                                </li>
                                <li className="nav-item">
                                    <Link className={'nav-link'} to={'/about'}>About</Link>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link" href="services.html">services</a>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link" href="blog.html">Blog</a>
                                </li>
                                <li className="nav-item dropdown">
                                    <a
                                        className="nav-link dropdown-toggle"
                                        href="blog.html"
                                        id="navbarDropdown"
                                        role="button"
                                        data-toggle="dropdown"
                                        aria-haspopup="true"
                                        aria-expanded="false"
                                    >
                                    Pages
                                    </a>
                                    <div className="dropdown-menu" aria-labelledby="navbarDropdown">
                                        <a className="dropdown-item" href="project.html">project</a>
                                        <a className="dropdown-item" href="single-blog.html"
                                        >Single blog</a
                                    >
                                    <a className="dropdown-item" href="elements.html">Elements</a>
                                    </div>
                                </li>
                                <li className="nav-item">
                                    <a className="nav-link" href="contact.html">Contact</a>
                                </li>
                                </ul>
                            </div>
                            <div className="social_icon d-none d-lg-block">
                                <a href="# "><i className="ti-facebook"></i></a>
                                <a href="# "><i className="ti-twitter-alt"></i></a>
                                <a href="# "><i className="ti-dribbble"></i></a>
                                <a href="# "><i className="ti-instagram"></i></a>
                            </div>
                            </nav>
                        </div>
                        </div>
                    </div>
                    </header>
                <Switch>
                    <Route exact path='/'><Home data={this.state.configData}/></Route>
                    <Route path='/about'><About /></Route>
                    <Route path='/service'><Service /></Route>
                    <Route path='/contact'><Contact contact={this.state.contactData} /></Route>
                    <Route path='/portfolio'><Portfolio /></Route>
                </Switch>
            </>
        );
    }
}

export default Header;
